import React from 'react';
import './Profile.css';
import {Link} from 'react-router-dom';

function edit(){
    var edit=document.getElementById('edit');
    var cancel=document.getElementById('cancel');
    var inputs=document.getElementsByTagName('input');
    var select=document.getElementsByTagName('select');
    if (edit.textContent=="Edit"){
        for (var ind=0;ind<inputs.length;ind++){
            inputs[ind].disabled=false;
        }
        for (var ind=0;ind<select.length;ind++){
            select[ind].disabled=false;
        }
        edit.textContent="Save";
        cancel.onclick=function(){
            cancelEdit();
        };
        console.log(cancel.onclick);
    }
    else{
        for (var ind=0;ind<inputs.length;ind++){
            inputs[ind].disabled=true;
        }
        for (var ind=0;ind<select.length;ind++){
            select[ind].disabled=true;
        }
        edit.textContent="Edit";
        cancel.onclick=function(){
            window.location.href='../../home/home.html';
        };
        console.log(cancel.onclick);
    }
}
function cancelEdit(){
    var edit=document.getElementById('edit');
    var cancel=document.getElementById('cancel');
    var inputs=document.getElementsByTagName('input');
    var select=document.getElementsByTagName('select');
    for (var ind=0;ind<inputs.length;ind++){
        inputs[ind].disabled=true;
    }
    for (var ind=0;ind<select.length;ind++){
        select[ind].disabled=true;
    }
    edit.textContent="Edit";
    cancel.onclick=function(){document.href="../home/home.html"};
}

function Profile(){
    return (
        <>
            <nav id='menu'>
                <ul class="menu_1">
                    <li tabindex="3">
                        <Link to="/workout" className='menu-link'>
                            <i class="fa-solid fa-dumbbell"></i>
                        </Link>
                    </li>
                    <li tabindex="2">
                        <Link to="/profile" className='menu-link active'>
                            <i class="fa-solid fa-user"></i>
                        </Link>
                    </li>
                </ul>
                <ul class="menu_2">
                    <li tabindex="1">
                        <Link to="/home" className='menu-link'>
                            <i class="fa-solid fa-house"></i>
                        </Link>
                    </li>
                    <li tabindex="4" style={{float: "right"}}>
                        <Link to="/" className='menu-link'>
                            Log out
                        </Link>
                    </li>
                </ul>
            </nav>
            <form className='measurements-profile'>
                <fieldset>
                    <legend>Measurements</legend>
                    <div className="weight-profile">
                        <label id='label-profile' htmlFor="weight-profile">Weight (kg): </label>
                        <input type="number" id="weight-profile" disabled/>
                    </div>
                    <div className="bodyFat-profile">
                        <label id='label-profile' htmlFor="bodyFat-profile">Body Fat (%): </label>
                        <input type="number" id="bodyFat-profile" disabled/>
                    </div>
                    <div className="waistLine-profile">
                        <label id='label-profile' htmlFor="waistLine-profile">Waistline (cm): </label>
                        <input type="number" id="waistLine-profile"disabled/>
                    </div>
                </fieldset>
            </form>
            <div className="btn-createProfile">
                <div>
                    <Link to='/home'>
                        <button id='create-createProfile'>Edit</button>
                    </Link>
                </div>
                <div>
                    <Link to='cover'>
                        <button id='cancel-createProfile'>Cancel</button>
                    </Link>
                </div>
            </div>
        </>
    );
}

export default Profile;
